import React from 'react';
import './App.css';

class App extends React.Component {

  state = {
    nome: ''
  }

  render() {
    return (
      <div>
        <label>Nome:</label>
        <input type="text" value={this.state.nome} onChange={(e) => this.setState({nome: e.target.value})} />
      </div>
    )
  }
}

export default App;
